import Resume from "./components/Resume";

function App() {
  const resume1 = {
    id: "1",
    name: "Hatice Karakuş",
    email: "haticekarakus@hotmail.com",
    phoneNumber: "5546542345",
    experiences: ["Web Developer", "Game Developer"],
    education: "Trakya University",
  };
  return (
    <div>
      <Resume item={resume1}></Resume>
    </div>
  );
}

export default App;
